import { useState } from 'react'
import { useNavigate } from 'react-router-dom';

function Signup() {
  const navigate = useNavigate();
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
  const [source, setSource] = useState('');
  const [city, setCity] = useState('');
  const [state, setState] = useState('');

  async function registerUser(event) {
      event.preventDefault();

      const response = await fetch('http://localhost:5000/api/register', {
          method: 'POST',
          headers: {
              'Content-Type': 'application/json',
          },
          body: JSON.stringify({
              name,
              email,
              phone,
              gender,
              source,
              city,
              state,
          }),
      });

      const data = await response.json();

      if (data.status === 'ok') {
          navigate('/login');
      }
  }

  return (
      <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh'}}>
          <div style={{width: '50%', padding: '20px', borderRadius: '10px', backgroundColor: '#f8f9fa'}}>
              <h1>Register</h1>
              <form onSubmit={registerUser}>
                 <input
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    type="text"
                    placeholder="Name"
                 />
                 <br />
                 <input
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    type="email"
                    placeholder="Email"
                 />
                 <br />
                 <input
                    value={phone}
                    onChange={(e) => setPhone(e.target.value)}
                    type="number"
                    placeholder="Phone"
                 />
                 <br />
                 <label>
                     Gender:
                     <select value={gender} onChange={(e) => setGender(e.target.value)}>
                         <option value="">Select</option>
                         <option value="male">Male</option>
                         <option value="female">Female</option>
                         <option value="others">Others</option>
                     </select>
                 </label>
                 <br />
                 <label>
                     How did you hear about this?
                     <input type="checkbox" value="LinkedIn" onChange={(e) => setSource(e.target.value)} /> LinkedIn
                     <input type="checkbox" value="Friends" onChange={(e) => setSource(e.target.value)} /> Friends
                     <input type="checkbox" value="Job Portal" onChange={(e) => setSource(e.target.value)} /> Job Portal
                     <input type="checkbox" value="Others" onChange={(e) => setSource(e.target.value)} /> Others
                 </label>
                 <br />
                 <label>
                     City:
                     <select value={city} onChange={(e) => setCity(e.target.value)}>
                         <option value="">Select</option>
                         <option value="Mumbai">Mumbai</option>
                         <option value="Pune">Pune</option>
                         <option value="Ahmedabad">Ahmedabad</option>
                     </select>
                 </label>
                 <br />
                 <input
                    value={state}
                    onChange={(e) => setState(e.target.value)}
                    type="text"
                    placeholder="State"
                 />
                 <br />
                 <input type="submit" value="Register" />
              </form>
          </div>
      </div>
  );
}

export default Signup;
